// Extract and transform incoming data
const body = $input.item.json.body;

// Extract form responses
const formResponses = body.form_responses || [];
const schoolName = formResponses.find(q => q.question_number === 1)?.response || "Unknown School";
const fees = formResponses.find(q => q.question_number === 2)?.response_label || "Not provided";
const travelTime = formResponses.find(q => q.question_number === 3)?.response || "Not provided";
const activities = formResponses.find(q => q.question_number === 4)?.selected_activities || [];
const hasAC = formResponses.find(q => q.question_number === 5)?.response || "No";
const classExcitement = formResponses.find(q => q.question_number === 6)?.response || 5;
const learningEnv = formResponses.find(q => q.question_number === 7)?.response || 5;

// Extract comparison scores
const categories = [
  { 
    name: "Teaching Quality", 
    our: body.our_score1 || 0, 
    gcm: body.other_score1 || 0,
    difference: (body.our_score1 || 0) - (body.other_score1 || 0)
  },
  { 
    name: "Facilities", 
    our: body.our_score2 || 0, 
    gcm: body.other_score2 || 0,
    difference: (body.our_score2 || 0) - (body.other_score2 || 0)
  },
  { 
    name: "Activities", 
    our: body.our_score3 || 0, 
    gcm: body.other_score3 || 0,
    difference: (body.our_score3 || 0) - (body.other_score3 || 0)
  },
  { 
    name: "Environment", 
    our: body.our_score4 || 0, 
    gcm: body.other_score4 || 0,
    difference: (body.our_score4 || 0) - (body.other_score4 || 0)
  },
  { 
    name: "Student Support", 
    our: body.our_score5 || 0, 
    gcm: body.other_score5 || 0,
    difference: (body.our_score5 || 0) - (body.other_score5 || 0)
  }
];

// Create detailed context for AI
const aiContext = `
School Comparison Analysis:

Current School: ${schoolName}
Comparison: GCM Convent School
Context: Rural background, seeking multi-dimensional excellence

Score Comparison:
- Teaching Quality: ${categories[0].our}% vs ${categories[0].gcm}%
- Facilities: ${categories[1].our}% vs ${categories[1].gcm}%
- Activities: ${categories[2].our}% vs ${categories[2].gcm}%
- Environment: ${categories[3].our}% vs ${categories[3].gcm}%
- Student Support: ${categories[4].our}% vs ${categories[4].gcm}%
- Overall: ${body.overall_score_our || 0}% vs ${body.overall_score_others || 0}%

Growth Potential:
- Happiness: +${body.happiness_difference || 0}%
- Ranking: #${body.ranking_difference || 0}
- Total Improvement: ${body.total_improvement_difference || 0}%

Family Context:
- Fees: ${fees}
- Travel: ${travelTime}
- Activities: ${activities.join(', ')}
- AC: ${hasAC}
- Excitement: ${classExcitement}/10
- Environment: ${learningEnv}/10

Key: Most schools excel in ONE area. GCM excels in ALL dimensions.
`;

// Prepare structured data
const structuredData = {
  timestamp: new Date().toISOString(),
  school_name: schoolName,
  comparison_school: body.others_name || "GCM Convent School",
  mobile_number: body.mobile_number,

  // Scores
  our_school_score: body.overall_score_our || 0,
  gcm_score: body.overall_score_others || 0,
  score_difference: (body.overall_score_our || 0) - (body.overall_score_others || 0),

  // Categories
  categories: categories,

  // Growth metrics
  happiness_difference: body.happiness_difference || 0,
  ranking_improvement: body.ranking_difference || 0,
  total_improvement: body.total_improvement_difference || 0,

  // Form context
  fees: fees,
  travel_time: travelTime,
  activities: activities.join(", "),
  activities_count: activities.length,
  has_ac: hasAC,
  class_excitement: classExcitement,
  learning_environment: learningEnv,

  // AI prompt context
  ai_context: aiContext,

  // Context
  school_type: "rural",
  gcm_advantage: "multi-dimensional excellence",

  // Raw form data
  form_responses: formResponses,

  // Retry tracking
  retry_count: 0,
  max_retries: 3
};

return { json: structuredData };

