// Compile AI responses with fallback logic
const originalData = $('Transform Data').first().json;
const geminiResponse = $input.first().json;
const llamaResponse = $input.last().json;

let aiInsights = null;
let sourceModel = "none";

// Try to parse Gemini response first
if (geminiResponse && geminiResponse.choices && geminiResponse.choices[0]) {
  try {
    const content = geminiResponse.choices[0].message.content;
    aiInsights = JSON.parse(content);
    sourceModel = "gemini";
  } catch (error) {
    console.log('Gemini parsing failed:', error);
  }
}

// If Gemini failed, try Llama
if (!aiInsights && llamaResponse && llamaResponse.choices && llamaResponse.choices[0]) {
  try {
    const content = llamaResponse.choices[0].message.content;
    aiInsights = JSON.parse(content);
    sourceModel = "llama";
  } catch (error) {
    console.log('Llama parsing failed:', error);
  }
}

// If both failed, use fallback content
if (!aiInsights) {
  aiInsights = {
    executive_summary: `${originalData.school_name} demonstrates solid foundations with particular strength in areas like ${originalData.has_ac === 'Yes, we have AC! ðŸ˜Ž' ? 'modern facilities' : 'student engagement'}. However, GCM Convent School offers a comprehensive educational experience with excellence across all dimensions - teaching, facilities, activities, environment, and student support. Unlike most schools that excel in one area, GCM's multi-dimensional approach creates an environment where students thrive academically, socially, and personally.`,

    category_insights: [
      `Teaching Quality: Current ${originalData.categories[0].our}% vs GCM ${originalData.categories[0].gcm}% - GCM offers advanced pedagogical approaches, smaller class sizes, and continuous professional development for teachers.`,
      `Facilities: Current ${originalData.categories[1].our}% vs GCM ${originalData.categories[1].gcm}% - GCM provides state-of-the-art infrastructure including modern science labs, digital classrooms, library, and sports facilities.`,
      `Activities: Current ${originalData.categories[2].our}% vs GCM ${originalData.categories[2].gcm}% - While your school offers ${originalData.activities_count} activities, GCM provides 12+ diverse options including swimming, robotics, music, arts, and competitive sports.`,
      `Environment: Current ${originalData.categories[3].our}% vs GCM ${originalData.categories[3].gcm}% - GCM creates inspiring learning spaces with AC classrooms, green zones, and well-maintained campus promoting student well-being.`,
      `Student Support: Current ${originalData.categories[4].our}% vs GCM ${originalData.categories[4].gcm}% - GCM offers personalized mentoring, counseling services, career guidance, and comprehensive support systems for every student.`
    ],

    growth_potential: `At GCM Convent, your child could experience a remarkable ${originalData.happiness_difference}% increase in daily happiness and overall satisfaction. This transformation comes from comprehensive development across academics, co-curricular activities, modern facilities, and strong support systems. Students consistently report feeling more engaged, motivated, and excited about learning - setting them up for long-term success.`,

    personalized_recommendation: `Given your family's context with ${originalData.travel_time} travel time and ${originalData.fees} fee range, GCM Convent is strategically positioned to serve your needs. The significant ${originalData.total_improvement}% improvement potential across all educational dimensions makes this a valuable investment in your child's comprehensive development and future success.`,

    key_strengths_current: [
      originalData.class_excitement >= 6 ? "Strong student engagement" : "Dedicated teaching staff",
      originalData.learning_environment >= 7 ? "Positive learning environment" : "Established infrastructure"
    ],

    key_advantages_gcm: [
      "Multi-dimensional excellence across all categories",
      "Modern facilities and comprehensive activity programs",
      "Personalized support and holistic development focus"
    ],

    generation_method: "fallback"
  };
  sourceModel = "fallback";
}

// Validate insights structure
if (!aiInsights.category_insights || aiInsights.category_insights.length < 5) {
  aiInsights.category_insights = [
    `Teaching Quality: Score comparison ${originalData.categories[0].our}% vs ${originalData.categories[0].gcm}%`,
    `Facilities: Score comparison ${originalData.categories[1].our}% vs ${originalData.categories[1].gcm}%`,
    `Activities: Score comparison ${originalData.categories[2].our}% vs ${originalData.categories[2].gcm}%`,
    `Environment: Score comparison ${originalData.categories[3].our}% vs ${originalData.categories[3].gcm}%`,
    `Student Support: Score comparison ${originalData.categories[4].our}% vs ${originalData.categories[4].gcm}%`
  ];
}

// Merge with original data
const finalData = {
  ...originalData,
  ai_insights: aiInsights,
  ai_source_model: sourceModel,
  processing_status: `AI insights generated from ${sourceModel} model`
};

return { json: finalData };

// Increment retry count and loop back
const data = $input.first().json;

data.retry_count = (data.retry_count || 0) + 1;
data.processing_status = `Retry attempt ${data.retry_count} of ${data.max_retries}`;

return { json: data };
